import React from 'react';

const Menu = ({ items, itemName }) => {
  const itemCount = items.length;

  return (
    <div>
      <h2>{itemName} Menu</h2>
      <p>Total {itemName}s Available: {itemCount}</p>
    </div>
  );
};

export default Menu;
